column8:
津田レーシングとビルシュタインとのコラボレーションによってついに完成した<br>
2～3インチアップした車高用のダンパー。<br>
 車高アップ車のサスペンションとのマッチングを最大限に考えた特性で、<br>
JB23特有のピッチングやロールを完全に解消し、乗り心地を改善。<br>
さらにはダートやモーグル等のオフロード性能までも可能な限り高めた最強のダンパーセットです。<br>
<br>
■フロント　MIN 305mm　MAX 490mm<br>
■リア　　  MIN 340mm  MAX 530mm<br><table width="800" cellspacing="0" cellpadding="5" border="0">
