津田レーシングとビルシュタインのコラボレーションによって誕生した極上のダンパーセットです。<br>
ダート、モーグル、ロックのオフロード性能はもちろんオンロードの乗り心地すら改善される今までになかったショックです。<br>
ビルシュタインのショックにありがちだった突き上げ感やコツコツ感も解消されています。<br>
 JA11 2～3インチアップ用です。<br>
<br>
